//import { BrowserRouter, Route, Routes } from "react-router-dom";
import AddIdiom from "./components/AddIdiom";

function App() {
  return (
    <div className="app">
      <BrowserRouter>
        <Routes>
          <Route path="/addIdiom" element={<AddIdiom/>} />
        </Routes>
      </BrowserRouter>
    </div>
  );
}

export default App;
